我们在业务中，有时候会遇到把字符串中的数字截取出来这种需求，比如

将 <code>var str = 12abc </code> 中的<code>12</code> 单独截取出来

<h2>方案一：</h2>

<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">var str = '12abc';
var num = parseInt(str);</pre>

&nbsp;

这是最简单的方式，但是在使用中会遇到两个问题

<ol>
    <li><code>parseInt(“abc”) = NaN</code>
纯字符串会返回<code>NaN</code>，但是我们期待得到的是 <code>1</code>，这个可以通过判断进行适配，不是大问题</li>
    <li><code>parseInt(“0xa”) = 10</code>
<code>0x</code> 开头的字符串，会被当作<code>16</code>进制的数字进行处理</li>
</ol>

<h2>方案二：</h2>

<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">var str = '12abc';
var num = parseInt(str.replace(/^0*/g,""));
console.log(num);//12</pre>

<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">var str = '0xbc';
var num = parseInt(str.replace(/^0*/g,""));
console.log(num);//NaN</pre>

先通过正则判断，将以<code>0</code>开头的字符串前的0去除，再利用<code>parseInt</code>。以<code>0</code>开头的字符串会返回<code>NaN</code>，因此需要再加一层判断以返回正确的结果

<h2>方案三：</h2>

<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">var str = '0xbc';
var num = str.match(/[\d]+/);
console.log(num); //[ '0', index: 0, input: '0xbc' ]
console.log(parseInt(num));//0


</pre>

<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">var str = 'abc';
var num = str.match(/[\d]+/);
console.log(num); //null
console.log(parseInt(num)); //NaN</pre>

&nbsp;

通过<code>match( RegExp )</code>方法，将字符串中的数字分离出来。对不含数字的字符串进行处理时，会返回<code>NaN</code>，因此需要专门进行一次适配。

爬虫的基本思路就是利用服务器发送<code>http</code>请求，获取对应<code>html</code>，再对<code>html</code>文本进行识别，获取页面中的有价值的信息；

