<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">superagent.get(url)
    .set(headers)
    .set('Cookie', cookie) // 设置cookie
    .charset(charset) //指定编码
    .end(function (err, res) {
        resolve(res)
        if (err) {
            reject(err)
        }
    })</pre>
