<h1 class="p1"><code>node-schedule</code></h1>
定时任务
<pre class="EnlighterJSRAW" data-enlighter-language="js" data-enlighter-theme="godzilla">function startSchedule() {
    var rule = new schedule.RecurrenceRule();
    var times = [];
    for (var i = 1; i &lt; 60; i++) {
        times.push(i);
    }
    rule.second = times;
    var c = 0;
    var j = schedule.scheduleJob(rule, function () {
        c++;
        console.log("*****开始拉取第" + c + "个页面*****");
        startNewReq();
    });
}//通过设置定时任务，每秒发起一个http请求</pre>
